  {
    subject: 'donnees_1', A: 120, B: 110, fullMark: 150,
  },
  {
    subject: 'donnees_2', A: 98, B: 130, fullMark: 150,
  },
  {
    subject: 'donnees_3', A: 86, B: 130, fullMark: 150,
  }

];
export default data_Arraignée
